import React from 'react'
import { CartIndv } from './CartIndv'

const Cart = ({cart}) => {
  return (
    <center>
        <div>
            {
                cart.map(function(item){
                    return(
                        <CartIndv image={item.image} title={item.title}/>
                    )
                })

                }
            
        </div>

    </center>
  )
}

export default Cart
